import React, { useState } from "react";

const App = () => {

    let [num, setNum] = useState(0);

    const increment = () => setNum(num + 1); 
    
    return(
        <>
            <h1>{num}</h1>
            <button onClick={increment}> + </button>
        </>
    );
}
export default App;
